import React from "react";

function Columns(props) {
  const { column } = props;
  return (
    <div>
      <table className="columble">
        <thead>
          {/* <tr>
            <th>Column Name</th>
            <th>Data Type</th>
          </tr> */}
        </thead>
        <tbody>
          <tr>
            <td>{column.column_name}</td>
          </tr>
          <tr>
            <td>({column.data_type})</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default Columns;
